import React, { useState, useEffect, useRef } from 'react';
import { Chart, registerables } from 'chart.js';
import './style.css';

Chart.register(...registerables);

const Admin = () => {
  const [stats, setStats] = useState([]);
  const [members, setMembers] = useState([]);
  const [loading, setLoading] = useState(true);
  const chartRef = useRef(null);

  const fetchData = async () => {
    setLoading(true);
    try {
      const membersResponse = await fetch('http://localhost:3001/api/members');
      const statsResponse = await fetch('http://localhost:3001/api/stats');
  
      if (!membersResponse.ok || !statsResponse.ok) {
        throw new Error('HTTP error!');
      }
  
      const membersData = await membersResponse.json();
      const statsData = await statsResponse.json();
  
      setMembers(membersData);
      setStats(statsData);
    } catch (error) {
      console.error('Error fetching data:', error);
    } finally {
      setLoading(false);
    }
  };
  
  useEffect(() => {
    fetchData();
    const intervalId = setInterval(fetchData, 24 * 60 * 60 * 1000); // 1일마다 업데이트

    return () => clearInterval(intervalId);
  }, []);

  useEffect(() => {
    if (chartRef.current) {
      const ctx = chartRef.current.getContext('2d');

      if (ctx.chart) {
        ctx.chart.destroy();
      }

      const labels = stats.map(stat => stat.date);
      const dataAdded = stats.map(stat => stat.added);
      const dataRemoved = stats.map(stat => stat.removed);

      const chart = new Chart(ctx, {
        type: 'bar',
        data: {
          labels: labels,
          datasets: [
            {
              label: 'Added',
              data: dataAdded,
              backgroundColor: '#36A2EB',
              borderColor: '#36A2EB',
              borderWidth: 1
            },
            {
              label: 'Removed',
              data: dataRemoved,
              backgroundColor: '#FF6384',
              borderColor: '#FF6384',
              borderWidth: 1
            }
          ]
        },
        options: {
          responsive: true,
          plugins: {
            legend: {
              display: true,
            },
            tooltip: {
              callbacks: {
                label: function(context) {
                  let label = context.dataset.label || '';
                  if (label) {
                    label += ': ';
                  }
                  if (context.parsed.y !== null) {
                    label += new Intl.NumberFormat().format(context.parsed.y);
                  }
                  return label;
                }
              }
            }
          },
          scales: {
            y: {
              beginAtZero: true
            }
          }
        }
      });

      ctx.chart = chart;

      return () => {
        chart.destroy();
      };
    }
  }, [stats]);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="admin-container">
      <div className="chart-section">
        <h2>Member Statistics</h2>
        <div className="chart-container">
          <canvas ref={chartRef} id="memberChart"></canvas>
        </div>
      </div>
      <div className="table-section">
        <h3>Member List</h3>
        <table className="members-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
            </tr>
          </thead>
          <tbody>
            {members.map(member => (
              <tr key={member.id}>
                <td>{member.id}</td>
                <td>{member.name}</td>
                <td>{member.email}</td>
                <td>{member.phone}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Admin;
